import React, { Component } from "react";

class Sidebar extends Component {
  render() {
    return (
      <div>
        <ul>
          <li>item 1</li>
          <li>item 2</li>
          <li>item 3</li>
          <li>item 4</li>
        </ul>
      </div>
    );
  }
}

export default Sidebar;
